              memberName={"Katherine Liu"}
              classYear={"2021"}
              description={""}
            />
            <TeamDescription
              memberName={"Denis Ebby"}
              classYear={"2021"}
              description={""}
            />
            <TeamDescription
              memberName={"Sebastian Yang"}
              classYear={"2022"}
              description={""}
            />
            <TeamDescription
              memberName={"Elizabeth Han"}
              classYear={"2022"}
              description={""}
            />
            <TeamDescription
              memberName={"Youngjoo Lee"}
              classYear={"2022"}
              description={""}
            />
            <TeamDescription
              memberName={"Alex Zhong"}
              classYear={"2022"}
              description={""}
            />
            <TeamDescription
              memberName={"Juan Diego Meza"}
              classYear={"2021"}
              description={""}
            />
            <TeamDescription
              memberName={"Konwoo Kim"}
              classYear={"2023"}
              description={
                "Konwoo studies computer science. He enjoys playing table tennis and poker."
              }
            />
            <TeamDescription
              memberName={"Eddie Li"}
              classYear={"2023"}
              description={
                "Eddie is in SCS and is interested in ML, Blockchain, and hardware hacking. He has two cats."
              }
            />
            <TeamDescription
              memberName={"Joseph Li"}
              classYear={"2023"}
              description={""}
            />
          </Col>
        </Row>
      </Container>

      <Footer />
    </FadeIn>
  );
}

export default Team;
